import * as React from 'react';
import { Fragment, useState } from 'react';
import { OnBoardOne, OnBoardTwo } from './Home';

export default () => {
    const [boarding, setOnboarding] = useState(1);
    return (
        <Fragment>
            {
                boarding === 2 && (
                    <OnBoardOne />
                )
            }

            {
                boarding === 2 && (
                    <OnBoardTwo />
                )
            }
        </Fragment>
    )
}
